Actionscript.script:
onClipEvent(load){
   function 排列物品图标()
   {
      temp_x = _root.购买物品界面.物品图标._x;
      temp_y = _root.购买物品界面.物品图标._y;
      temp_h = 28;
      temp_l = 28;
      temp_j = 8;
      temp_k = 10;
      换行计数 = 0;
      temp_a = [];
      p = 0;
      while(p < temp_j * temp_k)
      {
         _root.购买物品界面.attachMovie("物品图标","物品图标" + p,p);
         temp_a[p] = _root.购买物品界面["物品图标" + p];
         temp_a[p]._x = temp_x;
         temp_a[p]._y = temp_y;
         temp_x += temp_l;
         换行计数++;
         if(换行计数 == temp_j)
         {
            换行计数 = 0;
            temp_x = _root.购买物品界面.物品图标._x;
            temp_y += temp_h;
         }
         if(物品栏[p][0] == "空")
         {
            temp_a[p].gotoAndStop(物品栏[p][0]);
         }
         else
         {
            temp_a[p].图标 = "图标-" + _root.getItemData(物品栏[p][0]).icon;
            temp_a[p].gotoAndStop("默认图标");
         }
         if(物品栏[p][0] == undefined)
         {
            temp_a[p].gotoAndStop(1);
         }
         temp_a[p].数量 = 物品栏[p][1];
         temp_a[p].对应数组号 = p;
         temp_a[p].图标是否可对换位置 = 0;
         p++;
      }
   }
   function 删除物品图标()
   {
      i = 0;
      while(i <= 80)
      {
         _root.购买物品界面["物品图标" + i].removeMovieClip();
         i++;
      }
   }
   this._visible = 0;
   物品栏 = [];
}
